import React from 'react';
import { ALL_LANDS } from '../../data';
import { LandContainer } from './styles';

const Land = () => {

  return (
    <LandContainer>
      {ALL_LANDS.map(land => (
        <div key={ land.title }>
          <div className="land-card-img" />
          <span>{ land.title }</span>
          <p>{ land.description }</p>
        </div>
      ))}
    </LandContainer>
  );
}

export default Land;
